import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './UserHome.css'; // Import CSS file for styling

function UserHome() {
    const navigate = useNavigate();

    const handleLogout = () => {
        // Perform any necessary logout operations here
        alert("Logged out successfully");
        navigate("/");
    };

    return (
        <div className="user-home-container">
            <div className="navbar">
                <Link to="/" className="nav-button">Home</Link>
                <Link to="/about" className="nav-button">About</Link>
                <Link to="/contact" className="nav-button">Contact</Link>
                <button onClick={handleLogout} className="nav-button">Logout</button>
            </div>
            <div className="content">
                <h1>Welcome to EduConnect, User!</h1>
                <p>This is your user dashboard where you can access various features.</p>
                <p>Feel free to explore the available resources and tools provided here.</p>
                {/* Add any additional sections or features you want to display on the user home page */}
            </div>
        </div>
    );
}

export default UserHome;
